import React from 'react'
import PropTypes from 'prop-types'

export default function User(props) {
    const { name } = props
    return (
        <div>
            <p>Привет, {name}!</p>
        </div>
    )
}

propTypes = {
    name: PropTypes.string.isRequired,
}
